import React from "react";
import { Card } from "antd";

const UserProfile = () => {
  return (
    <Card
      actions={
        ((<div key="twit">트윗</div>),
        (<div key="followings">팔로잉</div>),
        (<div key="followings">팔로워</div>))
      }
    >
      <Card.Meta title />
    </Card>
  );
};

export default UserProfile;
